import React from 'react';
import project1 from '../assets/project1.png';

function Project() {
  return (
    <div className="min-h-screen place-items-start pt-5">
      <h1 className='font-bold text-4xl mt-4'>Selected Project</h1>
      <div className='pt-6'>
        <img src={project1} alt='project1' className='' />
      </div>
    </div>
  )
}

export default Project
